angular.module('app')

.controller('ViewDishCtrl', ['$scope', '$location', '$cordovaCamera', '$ionicPlatform', '$rootScope', 'server',
	function($scope, $location, $cordovaCamera, $ionicPlatform, $rootScope, server){
		$scope.dish = {};

		$ionicPlatform.ready(function () {

			$scope.takePicture = function(userSourchType) {

				var optionSourchType = userSourchType === 'camera' ? Camera.PictureSourceType.CAMERA : Camera.PictureSourceType.PHOTOLIBRARY;

				var options = {
					quality : 75,
					destinationType : Camera.DestinationType.DATA_URL,
					sourceType : optionSourchType,
					allowEdit : true,
					encodingType: Camera.EncodingType.JPEG,
					targetWidth: 300,
					targetHeight: 300,
					popoverOptions: CameraPopoverOptions,
					saveToPhotoAlbum: false
				};

				$cordovaCamera.getPicture(options).then(function(imageData) {

					$scope.dish.base64_string = "data:image/jpeg;base64," + imageData;

				}, function(error) {

					alert(error);

				});

			}

			$scope.save = function save() {

				var image = 'data:image/jpg;base64,';

				//$scope.dishes.push($scope.dish);

				server.setDish(image).then(function(response){

					console.log(response);

				}, function(error){

					console.log(response);

				});

			}

		});
}]);